import React from 'react';

import '../assets/css/MainComponent.css'

class MainContent extends React.Component {
    componentDidMount() {
        console.log('MainContent mounted');
    }
    render() {
        return (
            <div className="main-div">
                <div className="left-login">
                    <center><h2>Sign in</h2></center>
                    <input id="loginName" type="text" name = "loginName" placeholder="Username/email"></input>
                    <img id="user-img" src="https://image.flaticon.com/icons/svg/1077/1077114.svg"/>
                    <img id="lock-img" src="https://image.flaticon.com/icons/svg/526/526812.svg"/>
                    <input id="loginPassword" type = "password" name="loginPassword" placeholder="Password"></input>
                    <button id = "loginBtn"onClick=""> <img id="arrow-img" src="https://image.flaticon.com/icons/svg/271/271226.svg"/></button>
                </div>
                <div className="right-register">
                <center><h2>Register</h2></center>
                </div>
            </div>
        )
    }
}

export default MainContent;
